        float r, g, b;

        r = calculate_gamma(FFMIN(1.0f, v[x].re), gamma);

        g = calculate_gamma(FFMIN(1.0f, 0.5f * (v[x].re + v[x].im)), gamma);

        b = calculate_gamma(FFMIN(1.0f, v[x].im), gamma);

        c[x].yuv.y = 16.0f + 65.481f * r + 128.553f * g + 24.966f * b;

