{

    int err;

    FTPContext *s = h->priv_data;

    int written;



    av_dlog(h, "ftp protocol write %d bytes\n", size);



    if (s->state == DISCONNECTED) {

        if ((err = ftp_connect_data_connection(h)) < 0)

            return err;

    }

    if (s->state == READY) {

